import { useState } from "react";

interface Props {
  onClick?: () => void;
}

const Strategie = ({ onClick }: Props) => {
  const [showList, setShowList] = useState(false);

  function handleButtonClick() {
    setShowList(!showList);
    if (onClick) {
      onClick();
    }
  }
  const articles = [
    "Article 5",
    "Article 6",
    "Article 7",
    "Article 12",
    "Article 13",
    "Article 25",
    "Article 28",
    "Article 32",
    "Article 33",
    "Article 34",
    "Article 35"
  ];
    return (
    <>
      <button className="btn btn-info" onClick={handleButtonClick}>
        Articoli
      </button>
      {showList && (
        <ul>
          {fasi.map((fase, index) => (
            <li key={index}>{fase}</li>
          ))}
        </ul>
      )}
    </>
  );
};

export default Strategie;
